% Prompt the user to input the number of dimensions
n = input('Enter the number of dimensions (for x): ');

same_bounds_option = input('Do you want to enter separate bounds for each dimension? (Y/N): ', 's');
lower_bounds = ones(1,n);
upper_bounds = ones(1,n);
if strcmpi(same_bounds_option, 'Y')
