        upper_bounds(i) = input(['Enter the upper bound for dimension ', num2str(i), ': ']);
    end
else
    % Prompt the user to input a single value for lower and upper bounds
    lo = input('Enter lower bound : ');
    hi = input('Enter higher bound : ');
    lower_bounds = ones(1,n)*lo;
    upper_bounds = ones(1,n)*hi;
    lower_bounds(n) = 0;
    upper_bounds(n) = 0.1;
    
end

